import './App.css';
import FooterComponent from './Component/FooterComponent';
import HeaderComponent from './Component/HeaderComponent';
import ListEmployee from './Component/ListEmployee';

function App() {
	return (
		<div>
			<HeaderComponent />
			<ListEmployee />
			<FooterComponent />
		</div>
	);
}

export default App;
